description:
Duchess, The (2008)  

Verenigd Koninkrijk
Drama / Romantiek
110 minuten

geregisseerd door Saul Dibb
met Keira Knightley, Ralph Fiennes en Charlotte Rampling

Het leven van Georgiana, hertogin van Devonshire (Keira Knightley), staat in het teken van extravagantie en romantiek. Haar leefwijze komt haar echter dikwijls duur te staan en maakt haar een ideaal doelwit voor hen die een gevaar zien in de aristocratie.

Vanaf 19 maart in de bioscoop 


